            url:&quot;admin/oc/ajaxAprobar&quot;,
            data:{
                id:elId
            },
            type:&quot;post&quot;,
            dataType:&quot;json&quot;,
            success : function(response){

                if(response.respuesta == &quot;1&quot;){
                    modalAprobar.hide();

                    alert(&quot;Aprobación exitosa&quot;);
                    let inn = $(&quot;.btnAprobar[elId=&#039;&quot;+elId+&quot;&#039;]&quot;).parents(&quot;tr&quot;).eq(0).find(&quot;.bi-exclamation-circle-fill&quot;).eq(0);
