                    $(&quot;.btnAprobar[elId=&#039;&quot;+elId+&quot;&#039;]&quot;).remove();
                }else{
                    alert(&quot;No se pudo aprobar la orden, Inténtelo nuevamente&quot;);
                }
            }
        });
    });

